$scope.states = loadAll();

$scope.querySearch = querySearch;
$scope.selectedItemChange = selectedItemChange;
$scope.searchTextChange = searchTextChange;


function querySearch(query) {
    var results = query ? $scope.states.filter(createFilterFor(query)) : $scope.states,
    deferred;
    if ($scope.simulateQuery) {
        deferred = $q.defer();
        $timeout(function() {
            deferred.resolve(results);
        }, Math.random() * 1000, false);
        return deferred.promise;
    } else {
        return results;
    }
}

function searchTextChange(text) {
    $log.info('Text changed to ' + text);
}

function selectedItemChange(item) {
    if (item) {
        $rootScope.user.ville = item[1];
        $rootScope.user.code_postal = item[0];
    }
    $log.info('Item changed to ' + JSON.stringify(item));
}

$scope.startsWith = function(actual, expected) {
    var lowerStr = (actual + "").toLowerCase();
    return lowerStr.indexOf(expected.toLowerCase()) === 0;
}

    /**
     * Build `states` list of key/value pairs
     */
     function loadAll() {
        $http.get('data/villes.json').success(function(data) {
            $scope.states = data;
        });
    }

    /**
     * Create filter function for a query string
     */
     function createFilterFor(query) {
        var lowercaseQuery = angular.lowercase(query);

        return function filterFn(state) {
            return (state[0].indexOf(lowercaseQuery) === 0);
        };

    }
    $scope.fnVerifierRib = function() {

        var res = '';
        if ($scope.fnVerifierRib.arguments.length >= 3) {
            var bqe = $scope.fnVerifierRib.arguments[0];
            var gui = $scope.fnVerifierRib.arguments[1];
            var cpt = $scope.fnVerifierRib.arguments[2].toUpperCase();
            // Conversion du numero de compte en chiffres
            var tab = "ABCDEFGHIJKLMNOPQRSTUVWXYZ0123456789";
            var tab1 = "123456789123456789234567890123456789".split("");
            while (cpt.match(/\D/) !== null) {
                cpt = cpt.replace(/\D/, tab1[tab.indexOf(cpt.match(/\D/))]);
            }
            var cp = parseInt(cpt, 10);
            //Calcul cl RIB
            var a = bqe % 97;
            a = a * 100000 + parseInt(gui, 10);
            a = a % 97;
            a = a * Math.pow(10, 11) + cp;
            a = a % 97;
            a = a * 100;
            a = a % 97;
            a = 97 - a;
            if ($scope.fnVerifierRib.arguments.length > 3) {
                res = $scope.fnVerifierRib.arguments[3] = a;
            }
            else {
                res = a;
            }
            return res;
        }
        else {
            res = false;
            return res;
        }
    };

    $scope.verifRib = function() {
        $scope.verif = false;
        if ($rootScope.user.rib == undefined) {
            $scope.verif = true;
        } else {
            $scope.bnqInput = $rootScope.user.rib.nom_banque;
            $scope.iban = $rootScope.user.iban1 + $rootScope.user.iban2 + $rootScope.user.iban3 + $rootScope.user.iban4 + $rootScope.user.iban5 + $rootScope.user.iban6 + $rootScope.user.iban7;
            $scope.pref = $scope.iban.substr('0', '4');
            $scope.bnq = $scope.iban.substr('4', '5');
            $scope.guichet = $scope.iban.substr('9', '5');
            $scope.codecli = $scope.iban.substr('14', '11');
            $scope.lg = $scope.iban.length - 2;
            $scope.rib = $scope.iban.substr('-2');

            //4 premiers caractres de l'IBAN sont constitus de 2 lettres et 2 chiffres FR10
            if (!(/^(FR)[0-9]{2}$/m.test($scope.pref))) {
                $scope.verif = true;
            }
            //code banque saisi dans input banque correspond a code banque dans iban
            if (parseInt($scope.bnqInput) !== parseInt($scope.bnq)) {
                $scope.verif = true;
            }
            $scope.ribGen = $scope.fnVerifierRib($scope.bnqInput, $scope.guichet, $scope.codecli);
            if (parseInt($scope.rib.trim()) !== parseInt($scope.ribGen)) {
                $scope.verif = true;
            }
        }
    };
